Callback function when fetching N latest records from mongoDB collection<p>I'm having trouble writing a callback for fetching the latest N records from a mongoDB collection. I'm creating an Express route called /pp that will return stuff in my DB. I used to just return everything in it, so something like:</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-html lang-html prettyprint-override"><code>app.get("/pp", function (req, res) {
  PPOverTime.find({}, function (error, documents) {
      res.send(documents);
    });
});</code></pre>
</div>
</div>
</p>
<p>(PPovertime is the name of my collection btw)</p>
<p>But I want to now take the last N records placed into the DB, which according to the Stack Overflow post linked above is accomplished via &quot;db.foo.find().sort({_id:-1}).limit(30)&quot; for last 30 entries, for example.</p>
<p>So where do I put the callback function to return the response? I tried:</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-html lang-html prettyprint-override"><code>app.get("/pp", function (req, res) {
  PPOverTime.find()
    .limit(30)
    .sort({ _id: -1 }, function (error, documents) {
      res.send(documents);
    });
});</code></pre>
</div>
</div>
</p>
<p>But this gives an error because the sort function can only take in one argument. I guess more generally how do I do this asynchronously if I have more than one function to run on a find() call? Thanks.</p>

