Destructure arrays within the MongoDB aggregation pipeline<p>I was wondering if it was possible to destructure arrays while I am still in the MongoDB aggregation pipeline which would make my code alot neater.</p>
<p>For example, I have the following aggregation pipeline.</p>
<pre><code>await User.aggregate([
      { $match: { _id: userID } },
      {
        $project: { chatLogs: 1, username: 1, profilePicURL: 1 },
      },
      { $unwind: &quot;$chatLogs&quot; },
      {
        $lookup: {
          from: &quot;users&quot;,
          let: { recipientID: &quot;$chatLogs.recipientID&quot; },
          pipeline: [
            {
              $match: { $expr: { $eq: [&quot;$_id&quot;, &quot;$$recipientID&quot;] } },
            },
            { $project: { profilePicURL: 1 } },
          ],
          as: &quot;chatLogs.recipientID&quot;,
        },
      },
    ]);
</code></pre>
<p>This gives the following results when queried:</p>
<pre><code>{
        &quot;_id&quot;: &quot;5f2ffb54eea9c2180a732afa&quot;,
