        &quot;profilePicURL&quot;: &quot;/images/profile/default_profile.png&quot;,
        &quot;chatLogs&quot;: {
            &quot;recipientID&quot;: [
                {
                    &quot;_id&quot;: &quot;5f2faf5ad18a76073729f475&quot;,
                    &quot;profilePicURL&quot;: &quot;/images/profile/default_profile.png&quot;
                }
            ],
            &quot;chat&quot;: &quot;5f30b6c3d117441c2abda1ba&quot;
        }
    }
